import React, { Component } from 'react';

class Header extends Component {
  render() {

    return (
		<section id="header">
			<Container fluid>
			  <Row>
			    <Col>
			    	Bitch
			    </Col>
			  </Row>
			</Container>
		</section>
    );
  }
}

export default Header;
